hitBallTo: This function is used to hit the ball, when present, to another chain 1. Hitting Constraints function hitBallTo(uint256 _toChainId) public { if (ball.lastHitterAddress == address(0)) revert BallNotPresent(); if (_toChainId == block.chainid) revert InvalidDestination(); ...
} The ball contract variable is populated on the chain, indicating its presence The destination must be a different chain 2. Define The Receiving Handler modifier onlyCrossDomainCallback() { if (msg.sender != address(messenger)) revert CallerNotL2ToL2CrossDomainMessenger(); if (messenger.crossDomainMessageSender() != address(this)) revert InvalidCrossDomainSender(); _;
} function receiveBall(PingPongBall memory _ball) onlyCrossDomainCallback() external { // Hold reference to the ball ball = _ball; emit BallReceived(messenger.crossDomainMessageSource(), block.chainid, _ball);
} The handler simply stores reference to the received ball The handler can only be invokable by the cross chain messenger Since the contract is self-referential, the cross chain sender must be the same contract address 3. Hit The Ball Cross Chain function hitBallTo(uint256 _toChainId) public { ... // Construct a new ball PingPongBall memory newBall = PingPongBall(ball.rallyCount + 1, block.chainid, msg.sender); // Delete current reference delete ball; // Send to the destination messenger.sendMessage(_toChainId, address(this), abi.encodeCall(this.receiveBall, (newBall))); emit BallSent(block.chainid, _toChainId, newBall);
} Populate a new ball with updated properties Delete reference to the current ball so it's no longer hittable Invoke the contract on the destination chain matching the receiveBall handler defined in (2).
